const playBtn = document.getElementById('playBtn')
const stopBtn = document.getElementById('stopBtn')
let bellachao = new Audio('data:audio/x-mp3;base64,')
// bellachao.src = 'src/bella-chao-small.mp3'
playBtn.addEventListener('click', function() {
    console.log('PlayBtn Clicked')
    bellachao.play()
    bellachao.addEventListener('playing', function() {
        console.log('Bellachao Playing')
    })
    bellachao.addEventListener('ended', function() {
        console.log('Bellachao Ended')
    })
})
stopBtn.addEventListener('clicked', function() {
    console.log('StopBtn CLicked')
    bellachao.stop()
})

const playBtn2 = document.getElementById('playBtn2')
playBtn2.addEventListener('click', playAudio)
function playAudio() {
    bellachao.play()
}